import styled from "styled-components";

export const NavbarContainer = styled.nav`
    background : #4c6bee;
    display : flex;
    justify-content : center;
    font-size : 1rem;
    position : sticky;
    top : 0;
    z-indez : 10;

    @media screen and (max-width: 960px){
        transition : .8s all ease ;
    }
`
export const NavbarLogo = styled.div` 
    color : blue;
`
